} fn max<'a>(s1: &'a str, s2: &'a str) -> &'a str { if s1 > s2 { s1 } else { s2 }
} 编译器其实会自动进行生命周期标注 编译器希望尽可能减轻开发者的负担，其实所有使用了引用的函数，都需要生命周期的标注，只不过编译器会自动做这件事，省却了开发者的麻烦 编译器自动进行生命周期标注 无标注版本 fn main() { let s1 = "Hello world"; println!("first word of s1: {}", first(s1));
