} fn main() { let s = "hello world".to_owned(); let mut s1 = s.as_str(); let hello = strtok(&mut s1, ' '); println!("hello is: {}, s1: {}, s: {}", hello, s1, s);
} 按照编译器的规则， &mut &str 添加生命周期后变成 &’b mut &’a str 这将导致返回的 ’&str 无法选择一个合适的生命周期。 标注练习题参考 pub fn strtok<'a>(s: &mut &'a str, delimiter: char) -> &'a str { if let Some(i) = s.find(delimiter) { let prefix = &s[..i]; let suffix = &s[(i + delimiter.len_utf8())..]; *s = suffix; prefix } else { let prefix = *s; *s = ""; prefix }
} fn main() { let s = "hello world".to_owned(); let mut s1 = s.as_str(); let hello = strtok(&mut s1, ' '); println!("hello is: {}, s1: {}, s: {}", hello, s1, s);
} 标注练习示意图 生命周期标注的目的 生命周期标注的目的是，在参数和返回值之间建立联系或者约束 生命周期标注的目的是，在参数和返回值之间建立联系或者约束: 调用函数时，传入的参数的生命周期需要大于等于标注的生命周期。 当每个函数都添加好生命周期标注后，编译器，就可以从函数调用的上下文中分析出，在传参时，引用的生命周期，是否和函数签名中要求的生命周期匹配。 如果不匹配，就违背了“引用的生命周期不能超出值的生命周期”，编译器就会报错。

