let v: u64 = s.into(); 显然，第二种方法要更好，因为它符合软件开发的开闭原则（Open-Close Principle）， “软件中的对象（类、模块、函数等等）对扩展是开放的，但是对修改是封闭的”。 在第一种方式下，未来每次要添加对新类型的转换，都要重新修改类型 T 的实现 而第二种方式，我们只需要添加一个对于数据转换 trait 的新实现即可。 Rust 提供了两套不同的 trait 值类型到值类型的转换：From / Into / TryFrom / TryInto 引用类型到引用类型的转换：AsRef / AsMut From/Into: 值到值 这两种方式是等价的，怎么选呢？ let s = String::from("Hello world!");
let s: String = "Hello world!".into(); 这两种方式是等价的，怎么选呢？ From 可以根据上下文做类型推导，使用场景更多； 而且因为实现了 From 会自动实现 Into，反之不会。 所以需要的时候，不要去实现 Into，只要实现 From 就好了。 From 和 Into 还是自反的 把类型 T 的值转换成类型 T，会直接返回。这是因为标准库有如下的实现： // From（以及 Into）是自反的
impl<T> From<T> for T { fn from(t: T) -> T { t }
} 有了 From 和 Into，很多函数的接口就可以变得灵活 use std::net::{IpAddr, Ipv4Addr, Ipv6Addr}; fn print(v: impl Into<IpAddr>) { println!("{:?}", v.into());
} fn main() { let v4: Ipv4Addr = "2.2.2.2".parse().unwrap(); let v6: Ipv6Addr = "::1".parse().unwrap(); // IPAddr 实现了 From<[u8; 4]，转换 IPv4 地址 print([1, 1, 1, 1]); // IPAddr 实现了 From<[u16; 8]，转换 IPv6 地址 print([0xfe80, 0, 0, 0, 0xaede, 0x48ff, 0xfe00, 0x1122]); // IPAddr 实现了 From<Ipv4Addr> print(v4); // IPAddr 实现了 From<Ipv6Addr> print(v6);
} 函数如果接受一个 IpAddr 为参数，我们可以使用 Into 让更多的类型可以被这个函数使用 所以，合理地使用 From / Into，可以让代码变得简洁，符合 Rust 可读性强的风格，更符合开闭原则。 TryFrom/TryInto: 值到值，可能出现错误 注意，如果你的数据类型在转换过程中有可能出现错误，可以使用 TryFrom 和 TryInto，它们的用法和 From / Into 一样，只是 trait 内多了一个关联类型 Error，且返回的结果是 Result。 AsRef/AsMut: 引用到引用 AsRef/AsMut定义 pub trait AsRef<T> where T: ?Sized { fn as_ref(&self) -> &T;
} pub trait AsMut<T> where T: ?Sized { fn as_mut(&mut self) -> &mut T;
} 在 trait 的定义上，都允许 T 使用大小可变的类型，如 str、[u8] 等。 AsMut 除了使用可变引用生成可变引用外，其它都和 AsRef 一样，所以我们重点看 AsRef 体验一下 AsRef 的使用和实现 #[allow(dead_code)]
enum Language { Rust, TypeScript, Elixir, Haskell,
} impl AsRef<str> for Language { fn as_ref(&self) -> &str { match self { Language::Rust => "Rust", Language::TypeScript => "TypeScript", Language::Elixir => "Elixir", Language::Haskell => "Haskell", } }
} fn print_ref(v: impl AsRef<str>) { println!("{}", v.as_ref());
} fn main() { let lang = Language::Rust; // &str 实现了 AsRef<str> print_ref("Hello world!"); // String 实现了 AsRef<str> print_ref("Hello world!".to_string()); // 我们自己定义的 enum 也实现了 AsRef<str> print_ref(lang);
} v.as_ref().clone() 额外说明一下的是: 如果代码出现 v.as_ref().clone() 这样的语句，也就是说你要对 v 进行引用转换，然后又得到了拥有所有权的值，那么应该实现 From，然后做 v.into()。

