} fn main() { let mut buf = Buffer::new([1, 3, 2, 4]); // 因为实现了 Deref 和 DerefMut，这里 buf 可以直接访问 Vec<T> 的方法 // 下面这句相当于：(&mut buf).deref_mut().sort()，也就是 (&mut buf.0).sort() buf.sort(); println!("buf: {:?}", buf);
